    'about.about_Body': '<p>OLX \u0E40\u0E27\u0E47\u0E1A\u0E44\u0E0B\u0E15\u0E4C\u0E1B\u0E23\u0E30\u0E01\u0E32\u0E28\u0E42\u0E06\u0E29\u0E13\u0E32\u0E2D\u0E2D\u0E19\u0E44\u0E25\u0E19\u0E4C\u0E1F\u0E23\u0E35\u0E22\u0E38\u0E04\u0E43\u0E2B\u0E21\u0E48<br /><br />OLX \u0E04\u0E33\u0E15\u0E2D\u0E1A\u0E07\u0E48\u0E32\u0E22\u0E46 \u0E2A\u0E33\u0E2B\u0E23\u0E31\u0E1A\u0E1B\u0E31\u0E0D\u0E2B\u0E32\u0E22\u0E38\u0E48\u0E07\u0E22\u0E32\u0E01\u0E02\u0E2D\u0E07\u0E01\u0E32\u0E23\u0E0B\u0E37\u0E49\u0E2D\u0E02\u0E32\u0E22\u0E2A\u0E34\u0E19\u0E04\u0E49\u0E32 \u0E17\u0E33\u0E01\u0E32\u0E23\u0E04\u0E49\u0E32 \u0E15\u0E01\u0E25\u0E07\u0E1E\u0E39\u0E14\u0E04\u0E38\u0E22 \u0E08\u0E31\u0E14\u0E01\u0E32\u0E23\u0E41\u0E25\u0E30\u0E19\u0E31\u0E14\u0E2B\u0E21\u0E32\u0E22\u0E1C\u0E39\u0E49\u0E04\u0E19\u0E43\u0E01\u0E25\u0E49\u0E46 \u0E04\u0E38\u0E13<br /><br />\u0E17\u0E35\u0E48 OLX \u0E04\u0E38\u0E13\u0E2A\u0E32\u0E21\u0E32\u0E23\u0E16:<br /><ul><li>\u0E2D\u0E2D\u0E01\u0E41\u0E1A\u0E1A \u0E23\u0E34\u0E0A\u0E41\u0E2D\u0E14\u0E2A\u0E4C \u0E2D\u0E22\u0E48\u0E32\u0E07\u0E07\u0E48\u0E32\u0E22\u0E14\u0E49\u0E27\u0E22\u0E20\u0E32\u0E1E\u0E2B\u0E25\u0E32\u0E22\u0E46\u0E20\u0E32\u0E1E</li><li>\u0E04\u0E27\u0E1A\u0E04\u0E38\u0E21\u0E01\u0E32\u0E23\u0E0B\u0E37\u0E49\u0E2D\u0E02\u0E32\u0E22\u0E41\u0E25\u0E30\u0E01\u0E32\u0E23\u0E17\u0E33\u0E01\u0E34\u0E08\u0E01\u0E23\u0E23\u0E21\u0E0A\u0E38\u0E21\u0E0A\u0E19\u0E15\u0E48\u0E32\u0E07\u0E46 \u0E44\u0E14\u0E49\u0E43\u0E19\u0E40\u0E21\u0E19\u0E39 OLX \u0E02\u0E2D\u0E07\u0E09\u0E31\u0E19</li><li>\u0E41\u0E2A\u0E14\u0E07\u0E23\u0E32\u0E22\u0E01\u0E32\u0E23\u0E02\u0E2D\u0E07\u0E04\u0E38\u0E13\u0E1A\u0E19\u0E42\u0E1B\u0E23\u0E44\u0E1F\u0E25\u0E4C\u0E40\u0E04\u0E23\u0E37\u0E2D\u0E02\u0E48\u0E32\u0E22\u0E2A\u0E31\u0E07\u0E04\u0E21\u0E02\u0E2D\u0E07\u0E04\u0E38\u0E13 (Facebook, Myspace, ...)</li><li>\u0E40\u0E02\u0E49\u0E32\u0E2A\u0E39\u0E48\u0E40\u0E27\u0E47\u0E1A\u0E44\u0E0B\u0E15\u0E4C\u0E14\u0E49\u0E27\u0E22\u0E21\u0E37\u0E2D\u0E16\u0E37\u0E2D\u0E02\u0E2D\u0E07\u0E04\u0E38\u0E13</li><li>\u0E41\u0E2A\u0E14\u0E07 OLX \u0E43\u0E19\u0E20\u0E32\u0E29\u0E32\u0E17\u0E49\u0E2D\u0E07\u0E16\u0E34\u0E48\u0E19\u0E02\u0E2D\u0E07\u0E04\u0E38\u0E13</li></ul><br />OLX \u0E43\u0E2B\u0E49\u0E1A\u0E23\u0E34\u0E01\u0E32\u0E23\u0E43\u0E19 <<QTY_COUNTRIES>> \u0E1B\u0E23\u0E30\u0E40\u0E17\u0E28 <<QTY_LANGUAGES>> \u0E20\u0E32\u0E29\u0E32 \u0E1A\u0E23\u0E34\u0E29\u0E31\u0E17\u0E01\u0E48\u0E2D\u0E15\u0E31\u0E49\u0E07\u0E02\u0E36\u0E49\u0E19\u0E40\u0E21\u0E37\u0E48\u0E2D\u0E40\u0E14\u0E37\u0E2D\u0E19\u0E21\u0E35\u0E19\u0E32\u0E04\u0E21 2006 \u0E41\u0E25\u0E30\u0E40\u0E1B\u0E47\u0E19\u0E1A\u0E23\u0E34\u0E29\u0E31\u0E17\u0E40\u0E2D\u0E01\u0E0A\u0E19</p>',
